import React from "react";
import styled from "styled-components";

const ContainerDivStyle = styled.div`
  display: flex;
  height: 250px;
  padding: 0px 2vw;
  background: #0f212e;
  border-radius: 6px;
`;

const Slider = () => {
  return <ContainerDivStyle></ContainerDivStyle>;
};

export default Slider;
